        pointHoverBorderColor: 'rgba(220,220,220,1)',
        pointHoverBorderWidth: 2,
        pointRadius: 1,
        pointHitRadius: 10,
        data: info.map(popVal)
      }
    ]
  };


  return (
    <div>
      <h2>Line Example</h2>
      <Line 
        data={data}
        width={40}
        height={12}
      />
    </div>
  )
}
